// import "./style.css";
import { FiHome } from "react-icons/fi";
import { Link } from "react-router-dom";
import logo from "../../assets/img/COD_LOGO.png";
import { FiGithub, FiTwitter, FiInstagram } from "react-icons/fi";

function InfoHome() {
  return (
    <div className="footer-top">
      <div className="container">
        <div className="row">
          <div className="col-lg-4 col-md-6 footer-contact">
            <h4>Campus On Demand</h4>
            <p>
              IFES - Instituto Federal do Esp√≠rito Santo<br></br>
              Serra<br></br>
              Brazil<br></br>
              <strong>Phone:</strong>999999999<br></br>
              <strong>Email:</strong> info@example.com
            </p>
          </div>

          {/* <div className="col-lg-3 col-md-6 footer-links">
        <h4>Useful Links</h4>
        <ul>
        <li><i className="bx bx-chevron-right"></i> <Link to="#">Home</Link></li>
        <li><i className="bx bx-chevron-right"></i> <Link to="#">About us</Link></li>
        <li><i className="bx bx-chevron-right"></i> <Link to="#">Services</Link></li>
        <li><i className="bx bx-chevron-right"></i> <Link to="#">Terms of service</Link></li>
        <li><i className="bx bx-chevron-right"></i> <Link to="#">Privacy policy</Link></li>
        </ul>
    </div> */}

          <div className="col-lg-4 col-md-6 footer-links text-center">
            <h4>Our Services</h4>
            <ul>
              <li>
                <i className="bx bx-chevron-right text-center"></i>{" "}
                <Link to="#">Web Design</Link>
              </li>
              <li>
                <i className="bx bx-chevron-right"></i>{" "}
                <Link to="#">Web Development</Link>
              </li>
              <li>
                <i className="bx bx-chevron-right"></i>{" "}
                <Link to="#">Product Management</Link>
              </li>
              <li>
                <i className="bx bx-chevron-right"></i>{" "}
                <Link to="#">Marketing</Link>
              </li>
              <li>
                <i className="bx bx-chevron-right"></i>{" "}
                <Link to="#">Graphic Design</Link>
              </li>
            </ul>
          </div>

          <div className="col-lg-4 col-md-6 footer-links text-center">
            <h4>Redes Sociais</h4>
            <p>Siga-nos no github!</p>
            <div className=" mt-3">
              <Link to="#" className="color-icon-hs">
                <FiGithub />{" "}
              </Link>
              {/* <Link to="#" className="color-icon-hs"><FiTwitter/> </Link> */}
              {/* <Link to="#" className="color-icon-hs"><FiInstagram/> </Link> */}

              {/* <Link to="#" className="facebook"><i className="bx bxl-facebook"></i></Link> */}
              {/* <Link to="#" className="instagram"><i className="bx bxl-instagram"></i></Link> */}
              {/* <Link to="#" className="google-plus"><i className="bx bxl-skype"></i></Link> */}
              {/* <Link to="#" className="linkedin"><i className="bx bxl-linkedin"></i></Link> */}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default InfoHome;
